const Index = () => {
  return (
    <div>
      <div className="container-fluid">
        <div className="row">
          <List/>
          <div className="col-md-9 customSplash bg-light displayHidden">
            <h6 className="custSelectCenter">
              Please select a chat to start messaging
            </h6>
          </div>
        </div>
      </div>
    </div>
  );
};
export default Index;
